import logo from '../assets/logo.png'
import { Grid } from 'semantic-ui-react'

function Header() {
    return (
        <Grid>
            <Grid.Column>           
                <img style={{width:'300%'}} src={logo} alt="gymfinder logo" />
            </Grid.Column>
            <div style={{color: "whitesmoke"}}>Gym Finder</div>
        </Grid>
    ) 
}

export default Header
